defs.script:
			var classes = ['paraipaba','crateus','catarina','iguatu','cariri', 'sobral', 'santaquiteria', 'cascavel', 'redencao', 'pacajus', 'fortaleza', 'aracati'];
var cls1Elements = document.querySelectorAll('.cls-1');

classes.forEach(function(cls) {
  var elements = document.querySelectorAll('.' + cls);
  elements.forEach(function(element) {
    element.addEventListener('mouseover', function () {
      elements.forEach(function(el) {
        el.classList.add('scaled');
        el.parentNode.appendChild(el);
      });
      cls1Elements.forEach(function(el) {
        el.classList.add('transparent');
      });
    });
    element.addEventListener('mouseout', function () {
      elements.forEach(function(el) {
        el.classList.remove('scaled');
      });
      cls1Elements.forEach(function(el) {
        el.classList.remove('transparent');
      });
    });
    element.addEventListener('click', function () {
      alert('VocÃª clicou na classe: ' + this.className.baseVal);
    });
  });
});
